 'GG'\n6. 'W'\n7. 'JFF'\n8. 'JV'\n9. 'JGG'\n10. 'JW'\n\n\n","text/latex":"\\begin{enumerate*}\n\\item 'm0'\n\\item 'C0'\n\\item 'FF'\n\\item 'V'\n\\item 'GG'\n\\item 'W'\n\\item 'JFF'\n\\item 'JV'\n\\item 'JGG'\n\\item 'JW'\n\\end{enumerate*}\n","text/plain":" [1] \"m0\"  \"C0\"  \"FF\"  \"V\"   \"GG\"  \"W\"   \"JFF\" \"JV\"  \"JGG\" \"JW\" "},"metadata":{}}]},{"cell_type":"code","source":"matrices=set_up_dlm_matrices_unknown_v(Ft=Ft,Gt=Gt)\ninitial_states=set_up_initial_states_unknown_v(model$m0,model$C0,n0,S0)\n# fit discount DLM\n# MSE\ndf_range=seq(.9,1,by=.005)\nresults_MSE<-adaptive_dlm(data,matrices,initial_states,df_range,\"MSE\",forecast=FALSE)","metadata":{"execution":{"iopub.status.busy":"2023-05-06T09:38:21.581899Z","iopub.execute_input":"2023-05-06T09:38:21.583748Z","iopub.status.idle":"2023-05-06T09:38:21.615297Z"},"trusted":true},"execution_count":119,"outputs":[{"ename":"ERROR","evalue":"Error in Gt[, , i] %*% C0: non-conformable arguments\n","traceback":["Error in Gt[, , i] %*% C0: non-conformable arguments\nTraceback:\n","1. adaptive_dlm(data, matrices, initial_states, df_range, \"MSE\", \n .     forecast = FALSE)","2. forward_filter_unknown_v(data, matrices, initial_states, i)   # at line 51 of file <text>"],"output_type":"error"}]},{"cell_type":"markdown","source":"# Discount Factor","metadata":{}},{"cell_type":"code","source":"# print selected discount factor\nprint(paste(\"The selected discount factor:\", results_MSE$df_opt))\n# retrieve filtered results\nresults_filtered<-results_MSE$results_filtered\nci_filtered<-get_credible_interval_unknown_v(results_filtered$ft,results_filtered$Qt,results_filtered$nt)","metadata":{"execution":{"iopub.status.busy":"2023-05-06T09:38:32.650130Z","iopub.execute_input":"2023-05-06T09:38:32.651705Z","iopub.status.idle":"2023-05-06T09:38:32.671406Z"},"trusted":true},"execution_count":120,"outputs":[{"name":"stdout","text":"[1] \"The selected discount factor: 0.94\"\n","output_type":"stream"}]},{"cell_type":"code","source":"# retrieve smoothed results\nresults_smoothed<-results_MSE$results_smoothed\nci_smoothed<-get_credible_interval_unknown_v(results_smoothed$fnt,results_smoothed$Qnt,results_filtered$nt[length(results_smoothed$fnt)])","metadata":{"execution":{"iopub.status.busy":"2023-05-06T09:38:35.416949Z","iopub.execute_input":"2023-05-06T09:38:35.418585Z","iopub.status.idle":"2023-05-06T09:38:35.434917Z"},"trusted":true},"execution_count":121,"outputs":[]},{"cell_type":"markdown","source":"# Smoothing results","metadata":{}},{"cell_type":"code","source":"# Plot smoothing results\npar(mfrow=c(1,1))\nindex=timeseries_data$date\nplot(index,data$yt,ylab='Google Hits',main='Google Trends: time series',type='l',xlab='time',lty=3,ylim=c(0,100))\nlines(index,results_smoothed$fnt,type='l',col='blue',lwd=2)\nlines(index,ci_smoothed[,1],type='l',col='blue',lty=2)\nlines(index,ci_smoothed[,2],type='l',col='blue',lty=2)","metadata":{"execution":{"iopub.status.busy":"2023-05-06T09:38:37.959055Z","iopub.execute_input":"2023-05-06T09:38:37.960694Z","iopub.status.idle":"2023-05-06T09:38:38.119950Z"},"trusted":true},"execution_count":122,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ0AUVxcG4LOwLE1AuhSpImAXBSxYUFBsgKhRscauSeyJGguJxt6DvVfUqLHG\nWLB9VoIVpdkAFem91/1+DK7EFtS5rju+z6/Z3eGewyzl7J1bRFKplAAAAABA8SnJOwEAAAAA\n4AcKOwAAAACBQGEHAAAAIBAo7AAAAAAEAoUdAAAAgECgsAMAAAAQCBR2AAAAAAKBwg4AAABA\nIFDYAQAAAAgECjsAAAAAgUBhBwAAACAQKOwAAAAABAKFHQAAAIBAoLADAAAAEAgUdgAAAAAC\ngcIOAAAAQCBQ2AEAAAAIBAo7AAAAAIFAYQcAAAAgECjsAAAAAAQChR0AAACAQKCwAwAAABAI\nFHYAAAAAAoHCDgAAAEAgUNgBAAAACAQKOwAAAACBQGEHAAAAIBAo7AAAAAAEAoUdAAAAgECg\nsAMAAAAQCBR2AAAAAAKBwg4AAABAIFDYAQAAAAgECjsAAAAAgUBhBwAAACAQKOwAAAAABAKF\nHQAAAIBAoLADAAAAEAgUdgAAAAACgcIO4DMpLXi24/fZvTq42tQ00VRV0apuYNuguf+Inw5d\njpJ3am+XFNJV9FJsUdmnN3i4rqGoakyb//3p4XhRWhAly8r7bopccuD9jVA4uAIAVSeWdwIA\nX4Vrm6YMnLjiUU7xq6eK03LvpT25d33PxsUOXqP++OP3+loq8ksQvggtGzfMLi0